/* Elements for Resume Page */

import styled from "styled-components";

export const ResumeIframe = styled.iframe`
  flex: 1;
  overflow: hidden;
  height: ${window.screen.availHeight}px;
`;

export const ResumeContainer = styled.div`
  display: flex;
`;
